// @ts-nocheck
/* eslint-disable */
/* tslint:disable */
/* prettier-ignore-start */
import React from "react";
import { classNames } from "@plasmicapp/react-web";

export function Rectangle76Icon(props) {
  const { className, style, title, ...restProps } = props;
  return (
    <svg
      xmlns={"http://www.w3.org/2000/svg"}
      fill={"none"}
      viewBox={"0 0 1920 508"}
      height={"1em"}
      className={classNames("plasmic-default__svg", className)}
      style={style}
      {...restProps}
    >
      {title && <title>{title}</title>}

      <path
        d={
          "M0 24.591l495.083 45.295c4.725.432 9.487.19 14.144-.72L855.75 1.456a50 50 0 0115.002-.634l588.478 64.09c2.74.299 5.5.37 8.24.215L1920 39.5V508H0V24.591z"
        }
        fill={"currentColor"}
      ></path>
    </svg>
  );
}

export default Rectangle76Icon;
/* prettier-ignore-end */
